import { SessionService } from "../../services/user/session.service";
import { UserEntity } from "../../../domain/user/user.entity";
import { useFocusEffect } from "@react-navigation/native";
import { CRUDService } from "../../services/user/CRUD.service";
import React, { useState } from "react";
import { StyleSheet, Text, View, Image, TouchableOpacity,Button, ImageBackground } from "react-native";
import { useNavigation } from "@react-navigation/native";
import AsyncStorage from '@react-native-async-storage/async-storage';

export default function ProfileScreen() {

  
  const [currentUser, setCurrentUser] = useState<UserEntity | null>(null);
  const [photoUser, setPhotoUser] = useState("");
  const [auxPhotoUser, setAux] = useState("");
  const [loading, setLoading] = useState(false);
  const [cam, setCam] = useState(false);
  let CLOUDINARY_URL = "https://api.cloudinary.com/v1_1/diuyzbt14/upload";
  const navigation = useNavigation();

  const logOutButtonFunction = async () => {
    try {
      const nothing = "";
      AsyncStorage.setItem('token', nothing);
      navigation.navigate('LoginScreen' as never);
    } catch (error) {
      console.error("Error deleting the token: ", error);
    }
  };

  useFocusEffect(
    React.useCallback(() => {
      const getUser = async () => {
        const userId = await SessionService.getCurrentUser();
        if (userId) {
          try {
            await CRUDService.getUser(userId).then((response) => {
              setCurrentUser(response?.data);
            });
          } catch (error) {
            console.error("Error retrieving user:", error);
          }
        }
      };
      getUser();
    }, [])
  );
  
  return (
    <ImageBackground source={require('../../../../assets/visualcontent/background_8.png')} style={styles.backgroundImage}>
      <View style={styles.container}>
        <View style={styles.titleContainer}>
          <Text style={styles.text}>Profile</Text>
        </View>
        <View style={styles.profileContour}>
          {currentUser && (
            <View style={styles.profileContainer}>
              <View style={styles.profile}>
                <Text style={styles.profileUserName}>
                  {currentUser.appUser}
                </Text>
                <View style={styles.profileImage}>
                  <Image
                    source={{ uri: currentUser.photoUser }}
                    style={styles.image}
                  />
                </View>
                <View style={styles.profileUserButtons}>
                  <TouchableOpacity
                    onPress={() => {
                      navigation.navigate("Edit" as never);
                    }}
                    style={styles.buttonProfile}
                  >
                    <Text style={styles.buttonText}>Edit Profile</Text>
                  </TouchableOpacity>
                  <TouchableOpacity
                    onPress={() => {
                      // Acción al presionar el botón de Configuración
                    }}
                    style={styles.buttonProfile}
                  >
                    <Text style={styles.buttonText}>Settings</Text>
                  </TouchableOpacity>
                </View>
                <View style={styles.profileStats}>
                  <Text style={styles.text}>Followers</Text>
                  <TouchableOpacity
                    style={styles.profileStatCount}
                    onPress={() => {}}
                  >
                    <Text>{currentUser.followersUser?.length}</Text>
                  </TouchableOpacity>
                  <Text style={styles.text}>Following</Text>
                  <TouchableOpacity
                    style={styles.profileStatCount}
                    onPress={() => {}}
                  >
                    <Text>{currentUser.followedUser?.length}</Text>
                  </TouchableOpacity>
                </View>
                <View style={styles.profileBio}>
                  <Text style={styles.profileTitle}>Name</Text>
                  <Text>
                    <Text style={styles.profileRealName}>
                      {currentUser.nameUser}
                    </Text>
                  </Text>
                  <Text style={styles.profileTitle}>Description</Text>
                  <Text>{currentUser.descriptionUser}</Text>
                </View>
              </View>
              <Button title="LogOut" onPress={logOutButtonFunction} />
            </View>
          )}
        </View>
      </View>
    </ImageBackground>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "transparent",
    alignItems: "center",
    justifyContent: "center",
  },
  text: {
    fontSize: 24,
    fontWeight: "bold",
    color: "#000",
  },
  titleContainer: {
    marginBottom: 20,
  },
  profileContour: {
    alignItems: "center",
    justifyContent: "center",
  },
  profileContainer: {
    alignItems: "center",
    justifyContent: "center",
  },
  profile: {
    alignItems: "center",
    justifyContent: "center",
  },
  profileUserName: {
    fontSize: 28,
    fontWeight: "bold",
    color: "#000",
    marginTop: 12,
    marginBottom: 20,
  },
  profileImage: {
    width: 150,
    height: 150,
    borderRadius: 75,
    marginBottom: 20,
  },
  image: {
    width: "100%",
    height: "100%",
    borderRadius: 75,
  },
  profileUserButtons: {
    flexDirection: "row",
    marginBottom: 20,
  },
  buttonProfile: {
    margin: 4,
    padding: 6,
    backgroundColor: "#000",
    borderRadius: 20,
    color: "#66fcf1",
    fontSize: 14,
    width: 100,
    textAlign: "center",
  },
  buttonText: {
    color: "#66fcf1",
  },
  profileStats: {
    flexDirection: "row",
    justifyContent: "space-around",
    marginBottom: 20,
  },
  profileTitle: {
    fontSize: 12,
    marginBottom: -10,
  },
  profileStatCount: {},
  profileBio: {
    alignItems: "center",
    justifyContent: "center",
  },
  profileRealName: {
    fontSize: 16,
    fontWeight: "bold",
    marginBottom: 10,
  },
  backgroundImage: {
    flex: 1,
    resizeMode: 'cover',
  },
});
